import React, {useState} from 'react'

export default function JotterSidebarItem({jotters})
{
  const [edit, setEdit] = useState({
    id:null,
    value: ''
  })

  return jotters.map((jotter, index) =>(
  <div key={index}>
    <div key={jotter[0]}>
      {jotter[1]}
    </div>
  </div>
  ))
}
